import React, { Component } from 'react';
import Mainfirst from '../components/TradeMark/Mainfirst1';
import Footer from "../components/Footer";
import Header from "../components/Header";
import ListWord from "./../components/TradeMark/ListWord";
import GetImg from "./../components/TradeMark/GetImg";
import {addImg} from "./../actions/index";
import {connect} from "react-redux";
class WomensWatch extends Component {
  chooseTradeMark=(value)=>{
    this.props.addImages(value);
  }
  render() {
    var {imgtrademark}=this.props;
    var rowimg = imgtrademark.map((item,index) => {
      return (
        <div className="row" key={index}>
          <div className="col-xl-3">
            <img src={item.img1} alt="" />
          </div>
          <div className="col-xl-9 right-style">
            <div className="list-style">
              <a>
              <img src={item.img2} alt="" />
              </a>
              <img src={item.img3} alt="" />
            </div>
          </div>
        </div>
      )
    })
    return (
      <div>
        <Header />
        <section>
          <div className="container">
            <Mainfirst />
             <ListWord />
          <GetImg/>
          </div>
        </section>
        <Footer />
      </div>
    )
  }
}
const mapStateToProps=(state)=>{
  return{
    imgtrademark:state.imgtrademark
  }
}
const mapDispatchToProps=(dispatch)=>{
   return{
    addImages:(value)=>{
      dispatch(addImg(value))
    }
   }
}
export default connect(mapStateToProps,mapDispatchToProps)(WomensWatch);
